import React, { lazy, Component } from "react";
import { Link } from "react-router-dom";
import { data } from "../data";
import { ReactComponent as IconLaptop } from "bootstrap-icons/icons/laptop.svg";
import { ReactComponent as IconHeadset } from "bootstrap-icons/icons/headset.svg";
import { ReactComponent as IconPhone } from "bootstrap-icons/icons/phone.svg";
import { ReactComponent as IconTv } from "bootstrap-icons/icons/tv.svg";
import { ReactComponent as IconDisplay } from "bootstrap-icons/icons/display.svg";
import { ReactComponent as IconHdd } from "bootstrap-icons/icons/hdd.svg";
import { ReactComponent as IconUpcScan } from "bootstrap-icons/icons/upc-scan.svg";
import { ReactComponent as IconTools } from "bootstrap-icons/icons/tools.svg";

const Support = lazy(() => import("../components/Support"));
const Banner = lazy(() => import("../components/carousel/Banner"));
const Carousel = lazy(() => import("../components/carousel/Carousel"));
const CardIcon = lazy(() => import("../components/card/CardIcon"));
const CardLogin = lazy(() => import("../components/card/CardLogin"));
const CardImage = lazy(() => import("../components/card/CardImage"));
const CardDealsOfTheDay = lazy(() =>
    import("../components/card/CardDealsOfTheDay")
);

class HomeView extends Component {
  components = {
    IconLaptop,
    IconHeadset,
    IconPhone,
    IconTv,
    IconDisplay,
    IconHdd,
    IconUpcScan,
    IconTools,
  };

  render() {
    const iconProducts = data.iconProducts;
    const rows = [...Array(Math.ceil(iconProducts.length / 4))];
    const productRows = rows.map((_, idx) =>
        iconProducts.slice(idx * 4, idx * 4 + 4)
    );

    const carouselContent = productRows.map((row, idx) => (
        <div className={`carousel-item ${idx === 0 ? "active" : ""}`} key={idx}>
          <div className="row g-4">
            {row.map((product, idx) => {
              const ProductImage = this.components[product.img];
              return (
                  <div key={idx} className="col-6 col-md-3">
                    <CardIcon
                        title={product.title}
                        text={product.text}
                        tips={product.tips}
                        to={product.to}
                    >
                      <ProductImage className={`img-fluid ${product.cssClass}`} width="80" height="80" />
                    </CardIcon>
                  </div>
              );
            })}
          </div>
        </div>
    ));

    return (
        <>
          <Banner className="mb-4" id="carouselHomeBanner" data={data.banner} />
          <section className="container-fluid bg-light mb-4">
            <div className="row">
              <div className="col-lg-9 mb-4 mb-lg-0">
                <Carousel id="elect-product-category">
                  {carouselContent}
                </Carousel>
                <Support />
              </div>
              <div className="col-lg-3">
                <CardLogin className="mb-4" />
                <CardImage src="../../images/banner/Watches.webp" to="promo" />
              </div>
            </div>
          </section>

          <section className="container-fluid bg-light mb-4">
            <div className="row">
              <div className="col-12">
                <CardDealsOfTheDay
                    endDate={Date.now() + 1000 * 60 * 60 * 14}
                    title="Deals of the Day"
                    to="/"
                >
                  <Carousel id="elect-product-category1">
                    {carouselContent}
                  </Carousel>
                </CardDealsOfTheDay>
              </div>
            </div>
          </section>

          <section className="bg-info bg-gradient text-center py-4 mb-4">
            <h4 className="text-white m-0">Explore Fashion Collection</h4>
          </section>

          <section className="container">
            <div className="row">
              {["men", "women", "accessories", "footwear"].map((category, idx) => (
                  <div key={idx} className="col-6 col-md-3 mb-4">
                    <Link to="/" className="text-decoration-none">
                      <img
                          src={`/images/category/${category}.webp`}
                          className="img-fluid rounded-circle shadow"
                          alt={category}
                      />
                      <div className="text-center h6 mt-2 text-dark">{category}</div>
                    </Link>
                  </div>
              ))}
            </div>
          </section>
        </>
    );
  }
}

export default HomeView;
